import React, { useEffect } from 'react';
import { Redirect } from 'react-router-dom';
import { GetCurrentUser } from '../authService';

export default function AccessControl(Component) {
  if (!GetCurrentUser()) {
    return (<Redirect to="/login" />);
  }
  return (
    <Component />
  );
}
